import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class CarMake extends Component {

  handleMakeClick = (e) => {
    e.preventDefault();
    console.log(e.target.value, 'was clicked');
    const make = e.target.value
  }

  render() {
    const { make } = this.props
    return (
      <div>
        <Link to='/selectModel' className="button-div" value={make} onClick={this.handleMakeClick}>{make}</Link>
      </div>
    );
  }

}

export default CarMake;
